function getIcon(iconName,className=''){

	customSVG = ['insulation','areas','reheat','radiator','docx']
	featherSVG = ['home','layout','thermometer','wind','upload','download','x-circle','trash-2','help-circle']
	material = ['calculate','nest_true_radiant','check_box','picture_as_pdf']

	var svgText = ''

	if (customSVG.includes(iconName)){
	
		svgText = getSVG(iconName)
		svgText = svgText.replace('<svg', `<svg class="${className}"`);
	}
	if (featherSVG.includes(iconName)){
		//svgText = '<i data-feather="'+iconName+'"></i>'
		svgText = feather.icons[iconName].toSvg()
		svgText = svgText.replace('<svg', `<svg class="${className}"`);
	}				
	if (material.includes(iconName)){
		svgText = '<span class="material-symbols">'+iconName+'</span>'
	}
	
	return svgText
	
	
}







